import React from 'react';

import '../App.css';

{/* Privacy page */}

function Privacy() {
    return (
        <div>
            <div className="center">
            <h1>Privacy Policy</h1>
            <p>We, at ToUpper LLC, understand the importance of privacy</p>
            </div>
        </div>
    );
}

export default Privacy;
